const Hero = ({ text, backdrop }) => {
  return (
    <div>
    <header className="bg-dark text-white p-5 hero-container">
      <h1 className="hero-text">{text}</h1>
      {backdrop &&
        <div className="hero-backdrop" style={{backgroundImage: `url(${backdrop})`}}></div>
      }
    </header>
    <footer className="footer text-light text-center  bg-dark pb-2 pt-2">
    Developed by Alisha Lohani 2023
  </footer>
  </div>
  )
}

export default Hero;
